import React from 'react';


const Home = () => {
    return <div className='homePageWrapper'>
        <div className="formWrapper">
            <img
                    className="homePageLogo"
                    src="/code-sync.png"
                    alt="code-sync-logo"
                />
        </div>
    </div>;
};
export default Home;
